==Untitled==
Heavy bombers? I think it was a fighter field with grass runways, but I have no source of information on this. [[User:Sangwine|Sangwine]] 22:18, 10 January 2007 (UTC).

Definitely a heavy Bomber field with 3 concrete runways in North Norfolk.  Stirlings and Halifaxes of 199 Sqn and 171 Squadron were incumbent as a part of [[No. 100 Group RAF]], there may have been others too.  If you travel the main road from [[Fakenham]] to [[Wells-next-the-Sea]] in Norfolk you pass through what remains of the technical site (now an animal feed mill) at a place called Egmere. [[User:RobertWalden|Rob]] 08:22, 11 January 2007 (UTC)

